import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super()
    this.state = {
      name: ''
    }
    this.getChamp = this.getChamp.bind(this);
  }

  componentDidMount(){
    this.getChamp()
  }

  getChamp() {
    fetch('http://ddragon.leagueoflegends.com/cdn/10.5.1/data/en_US/champion.json').then(response => response.json()).then(champ => {
      console.log(champ.data);
      champ.data.forEach(obj => {
       Object.entries(obj).forEach(([key, value]) => {
           console.log(`${key} ${value}`)
       })
       console.log('-------------------')
    })
  })
}
  render (){
    return(<div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
        </a>
      </header>
    </div>)
  };
}

export default App;
